import { useState } from 'react';

const Example = () => {
  const [btnA, setBtnA] = useState(0);
  const [btnB, setBtnB] = useState(10);
  const [btnC, setBtnC] = useState(100);
  return (
    <>
      <p>ボタンAを{btnA}回押しました!</p>
      <button
        onClick={() => {
          setBtnA(btnA + 1);
        }}
      >
        ボタンA
      </button>
      <p>ボタンBを{btnB}回押しました!</p>
      <button>ボタンB</button>
      <p>ボタンCを{btnC}回押しました!</p>
      <button>ボタンC</button>
    </>
  );
};

export default Example;
